    def list_pokemons(self):
        i = 0
        pokeballs = []
        for k, v in self._pokemons.items():
            pokeballs.append((i, k, len(v)))
            i += 1
        return pokeballs

    def choose_by_id(self, index: int, subindex=0, rnd=False):
        poke_list = list(self._pokemons.values())
        if rnd:
            pokemon_b64 = random.choice(poke_list[index])
        else:
            pokemon_b64 = poke_list[index][subindex]

        try:
            res = str(base64.b64decode(pokemon_b64), "ascii")
        except UnicodeDecodeError as e:  # for some reason pokemon 148; subindex 0 (dragonair) contains a non ascii char
            res = str(base64.b64decode(pokemon_b64), "utf-8")

        return res

    def choose_by_name(self, name: str, subindex=0, rnd=False):
        if "nidoran" in name:
            if name.endswith("f"):
                name = "nidoran♀"
            elif name.endswith("m"):
                name = "nidoran♂"
        if rnd:
            pokemon_b64 = random.choice(self._pokemons[name])
        else:
            pokemon_b64 = self._pokemons[name][subindex]

        try:
            res = str(base64.b64decode(pokemon_b64), "ascii")
        except UnicodeDecodeError as e:  # for some reason pokemon 148; subindex 0 (dragonair) contains a non ascii char
            res = str(base64.b64decode(pokemon_b64), "utf-8")

        return res

    def __repr__(self):
        return copy.deepcopy(self._pokemons)

    @property
    def pokemons(self):
        return self._pokemons
